import React from "react";
import { useState } from "react"
import './bottomNavigation.css';
import "@fontsource/red-hat-display";
import logo from './logo.svg';
import hamburger from './hamburger.svg';

import './min.css'
function BottomNavigation(){

    return(
        <div className="bottomNav">
            <div className="row">
                <div><img src={logo} style={{width:'100%'}}/><h3 style={{color: '#273B42','font-weight': '700'}}>Governance</h3></div>
                <div className="box white-background text-center"><img src={logo} style={{width:'100%'}}/><p className="service-specific-text">UI/UX Prototype</p></div>
            </div>
        </div>
    );
}
/* Confederacie. */

/* identical to box height */




export default BottomNavigation;
